package desafio.gbx.desafio.entity;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import java.time.LocalDateTime;@Data@Entity@NoArgsConstructor@AllArgsConstructorpublic class TransacaoEntity {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private long id;    @ManyToOne    private UsuarioEntity contaOrigem;    @ManyToOne    private UsuarioEntity contaDestino;    private double valor;    private LocalDateTime data;}